import TodoForm from "./TodoForm";
import TodoItems from "./TodoItems";

function Todolist(props) {
    const tasks = props.tasks;
    return (
        <div className="todolist">
            <TodoForm />
            <TodoItems tasks={tasks} />
        </div>
    );
}

export default Todolist;
